import DeleteIcon from '@mui/icons-material/Delete';
export default function Topbar() {
    return (
        <div className='topbar'>
        <div className="wrapper">
            <div className="left">
                <a href="#intro" className="logo">muratKARA;</a>
                <div className="itemContainer">
                <DeleteIcon />
                </div>
            </div>
            <div className="right">
                this is right.
            </div>            
        </div>
        </div>
    )
}
